    mymap.addLayer({
        'id': 'avalanche-boundary',
        'type': 'fill',
        'source': 'avalanches',
        'paint': {
        'fill-color': '#E87143',
        'fill-opacity': 0.4,
        'fill-outline-color' : '#E8434A'
        },
        'filter': ['==', '$type', 'Polygon']
    });

    // When a click event occurs on a feature in the places layer, open a popup at the
    // location of the feature, with description HTML from its properties.
    // When a click event occurs on a feature in the states layer, open a popup at the
// location of the click, with description HTML from its properties.
    mymap.on('click', 'avalanche-boundary', function(e) {
        new mapboxgl.Popup()
        .setLngLat(e.lngLat)
        .setHTML("surface: " + e.features[0].properties.area + " m </br>" + "primtre : " + e.features[0].properties.perimeter + " m")
        .addTo(mymap);
        });
        
    // Change the cursor to a pointer when the mouse is over the states layer.
    mymap.on('mouseenter', 'avalanche-boundary', function() {
        mymap.getCanvas().style.cursor = 'pointer';
    });
     
    // Change it back to a pointer when it leaves.
    mymap.on('mouseleave', 'avalanche-boundary', function() {
        mymap.getCanvas().style.cursor = '';
    });
